import React ,{ createContext, useReducer } from "react";

const INITIAL_STATE = {
    Name: undefined,
    city: undefined,
    id: undefined,
    city: undefined,

    dorms: [],
    Coordinates: {
        lag: undefined,
        long: undefined,
    },
    img:undefined
};

export const SearchContext = createContext(INITIAL_STATE);


export const SearchContextProvider = ({ children }) => {

    return (
        <SearchContext.Provider
            value={{
                city: state.city,
                Name: state.Name,
                id: state.id,
            }}
        >
            {children}
        </SearchContext.Provider>
    );
};
